ary.</td> </tr> </table> <p><b>Rich</b> describes someone possessing <a href="/wiki/Wealth" title="Wealth">wealth</a>.</p> <p><b>Rich</b> may also refer to:</p> <div style="clear: right; margin-bottom: .5em; float: right; padding: .5em 0 .8em 1.4em; background: none; width: auto;"> <div id="toc" class="toc"> <div class="toctitle"> <h2>Contents</h2> </div> <ul> <li class="toclevel-1 tocsection-1"><a href="#Places"><span class="tocnumber">1</span> <span class="toctext">Places</span></a> <ul> <li class="toclevel-2 tocsection-2"><a href="#United_States"><span class="tocnumber">1.1</span> <span class="toctext">United States</span></a></li> <li class="toclevel-2 tocsection-3"><a href="#Elsewhere"><span class="tocnumber">1.2</span> <span class="toctext">Elsewhere</span></a></li> </ul> </li> <li class="toclevel-1 tocsection-4"><a href="#People"><span class="tocnumber">2</span> <span class="toctext">People</span></a></li> <li class="toclevel-1 tocsection-5"><a href="#Arts_and_entertainment"><span class="tocnumber">3</span> <span class="toctext">Arts and entertainment</span></a></li> <li class="toclevel-1 tocsection-6"><a href="#Navy_ships"><span class="tocnumber">4</span> <span class="toctext">Navy ships</span></a></li> <li class="toclevel-1 tocsection-7"><a href="#Businesses"><span class="tocnumber">5</span> <span class="toctext">Businesses</span></a></li> <li class="toclevel-1 tocsection-8"><a href="#Science_and_technology"><span class="tocnumber">6</span> <span class="toctext">Science and technology</span></a></li> <li class="toclevel-1 tocsection-9"><a href="#Other"><span class="tocnumber">7</span> <span class="toctext">Other</span></a></li> <li class="toclevel-1 tocsection-10"><a href="#See_also"><span class="tocnumber">8</span> <span class="toctext">See also</span></a></li> </ul> </div> </div> <h2><span class="mw-headline" id="Places">Places</span><span class="mw-editsection"><span class="mw-editsection-bracket">[</span><a href="/w/index.php?title=Rich&amp;action=edit&