section: People">edit</a><span class="mw-editsection-bracket">]</span></span></h2> <ul> <li><a href="/wiki/Rich_(surname)" title="Rich (surname)">Rich (surname)</a></li> <li><a href="/wiki/Rich_(given_name)" title="Rich (given name)">Rich (given name)</a>, often short for Richard</li> </ul> <h2><span class="mw-headline" id="Arts_and_entertainment">Arts and entertainment</span><span class="mw-editsection"><span class="mw-editsection-bracket">[</span><a href="/w/index.php?title=Rich&amp;action=edit&amp;section=5" title="Edit section: Arts and entertainment">edit</a><span class="mw-editsection-bracket">]</span></span></h2> <ul> <li><a href="/wiki/Richie_Rich_(comics)" title="Richie Rich (comics)">Richie Rich (comics)</a>, a fictional character</li> <li>half of <a href="/wiki/Big_%26_Rich" title="Big &amp; Rich">Big &amp; Rich</a>, an American country music duo</li> <li>Rich Velonskis, half of the American duo <a href="/wiki/Nikki_%26_Rich" title="Nikki &amp; Rich">Nikki &amp; Rich</a></li> <li>"Rich", a song by The Yeah Yeah Yeahs, from the album <i><a href="/wiki/Fever_to_Tell" title="Fever to Tell">Fever to Tell</a></i></li> <li><a href="/wiki/DS_Terry_Rich" class="mw-redirect" title="DS Terry Rich">DS Terry Rich</a>, a character in the British soap opera <i>EastEnders</i></li> <li><a href="/wiki/Rich_Hardbeck" title="Rich Hardbeck">Rich Hardbeck</a>, a character in the British television series <i>Skins</i></li> <li><a href="/wiki/Rich_(Skins)" class="mw-redirect" title="Rich (Skins)">"Rich" (<i>Skins</i>)</a>, an episode of the television series <i>Skins</i></li> </ul> <h2><span class="mw-headline" id="Navy_ships">Navy ships</span><span class="mw-editsection"><span class="mw-editsection-bracket">[</span><a href="/w/index.php?title=Rich&amp;action=edit&amp;section=6" title="Edit section: Navy ships">edit</a><span class="mw-editsection-bracket">]</span></span></h2> <ul> <li><a href="/wiki/USS_Rich_(DE-695)" title="USS Rich (DE-695)">USS <i>Rich</i> (DE-695)</a>, a Buckley-class destroyer escort in World War II</li> <li><a href="/wiki/USS_Rich_(DD-820)" title="USS Rich (DD-820)">USS <i>Rich</i> (DD-820)</a>, a Gearing-class destroyer in the Korean War and Vietnam War</li> </ul> <h2><span class="mw-headline" id="Businesses">Businesses</span><span class="mw-editsection"><span class="mw-editsection-bracket">[</span><a href="/w/index.php?title=Rich&amp;action=edit&amp;section=7" title="Edit section: Businesses">edit</a><span class="mw-editsection-bracket">]</span></span></h2> <ul> <li><a href="/wiki/Rich_International_Airways" title="Rich International Airways">Rich International Airways</a>, former U.S. airline</li> <li><a href="/wiki/Rich_Products" title="Rich Products">Rich Products</a>, international food products corporation</li> <li><a href="/wiki/Rich_%26_Cowan" title="Rich &amp; Cowan">Rich &amp; Cowan</a>, UK book publishing company</li> <li><a href="/wiki/Rich%27s_(department_store)" title="Rich's (department store)">Rich's (department store)</a>, U.S. department store retail chain in the southern U.S.</li> <li><a href="/wiki/Rich%27s_Department_Stores" class="mw-redirect" title="Rich's Department Stores">Rich's Department Stores</a>, U.S. department store retail chain in the northeastern U.S.</li> </ul> <h2><span class="mw-headline" id="Science_and_technology">Science and technology</span><span class="mw-editsection"><span class="mw-editsection-bracket">[</span><a href="/w/index.php?title=Rich&amp;action=edit&amp;section=8" title="Edit section: Science and technology">edit</a><span class="mw-editsection-bracket">]</span></span></h2> <ul> <li>Rich, in combustion engines, referring to an <a href="/wiki/Air-fuel_ratio" class="mw-redirect" title="Air-fuel ratio">air-fuel ratio</a> which has an excess amount of fuel beyond what is required for complete combustion</li> <li><a href="/wiki/Ring_imaging_Cherenkov_detector" class="mw-redirect" title="Ring imaging Cherenkov detector">Ring imaging Cherenkov detector</a>, a particle detector</li> </ul> <h2><span class="mw-headline" id="Other">Other</span><span class="mw-editsection"><span class="mw-editsection-bracket">[</span><a href="/w/index.php?title=Rich&amp;action=edit&amp;section=9" title="Edit section: Other">edit</a><span class="mw-editsection-bracket">]</span></span></h2> <ul> <li><a href="/wiki/Rich_(wine)" class="mw-redirect" title="Rich (wine)">Rich (wine)</a>, a descriptor in wine tasting</li> <li><a href="/wiki/Baron_Rich" title="Baron Rich">Baron Rich</a>, an extinct title in the Peerage of England</li> <li><a href="/wiki/Rich_baronets" title="Rich baronets">Rich baronets</a>, four titles, three of which are extinct and one dormant</li> </ul> <h2><span class="mw-headline" id="See_also">See also</span><span class="mw-editsection"><span class="mw-editsection-bracket">[</span><a href="/w/index.php?title=Rich&amp;action=edit&amp;section=10" title="Edit section: See also">edit</a><span class="mw-editsection-bracket">]</span></span></h2> <ul> <li><a href="/wiki/List_of_people_known_as_the_Rich" title="List of people known as the Rich">List of people known as the Rich</a></li> <li><a href="/wiki/B.C._Rich" title="B.C. Rich">B.C. Rich</a>, guitar manufacturer</li> <li><a href="/wiki/Er-Rich" title="Er-Rich">Er-Rich</a>, Morocco, a town</li> </ul> <table id="disambigbox" class="metadata plainlinks dmbox dmbox-disambig" style="" role="presentation"> <tr> <td class="mbox-image" style="padding: 2px 0 2px 0.4em;"><a href="/wiki/File:Disambig_gray.svg" class="image"><img alt="Disambiguation icon" src="//upload.wikimedia.org/wikipedia/en/thumb/5/5f/Disambig_gray.svg/30px-Disambig_gray.svg.png" width="30" height="23" srcset="//upload.wikimedia.org/wikipedia/en/thumb/5/5f/Disambig_gray.svg/45px-Disambig_gray.svg.png 1.5x, //upload.wikimedia.org/wikipedia/en/thumb/5/5f/Disambig_gray.svg/60px-Disambig_gray.svg.png 2x" data-file-width="220" data-file-height="168" /></a></td> <td class="mbox-text" style="padding: 0.25em 0.4em; font-style: italic;">Th